void iconLocation(M5EPD_Canvas& canvas1, uint16_t x, uint16_t y, uint16_t s) {
    canvas1.fillCircle(x + s / 2, y + s / 3, s / 3, MYBLACK);
    canvas1.fillTriangle(x + s / 2, y + s, (x + s / 2) - s / 3.75, y + s / 2, (x + s / 2) + s / 3.5, y + s / 2, MYBLACK);
    canvas1.fillCircle(x + s / 2, y + s / 3, s / 6, MYWHITE);

}

